class Solution(object):
    def countDigitOne(self, n):
        """
        :type n: int
        :rtype: int
        """

        count = 0
        i = 1
        while i <= n:
            quotient = n // i
            remainder = n % i
            count += quotient * i
            if remainder == 0:
                count += remainder
            elif remainder == 1:
                count += remainder + quotient + 1
            else:
                count += remainder + i
            i *= 10
        return count

