                max2 = max1
                max1 = num
            elif num > max2 and num < max1:
                max3 = max2
                max2 = num
            elif num > max3 and num < max2:
                max3 = num

        return max3 if max3 != float('-inf') else max1

class Solution(object):
    def thirdMax(self, nums):
        """
        :type nums: List[int]
        :rtype: int
        """

        max1 = max2 = max3 = float('-inf')

        for num in nums:
            if num > max1:
                max3 = max2
                max2 = max1
                max1 = num
            elif num > max2 and num < max1:
                max3 = max2
                max2 = num
            elif num > max3 and num < max2:
                max3 = num

        return max3 if max3 != float('-inf') else max1
